import React from 'react';
import useTitle from '@Utils/hooks/useTitle';

import fetchFacebook from '@Utils/hooks/fetchFacebook';
import { FacebookEmbed } from 'react-social-media-embed';

function Actualites() {
	useTitle('G&F87 | Actualites');

	const { posts, loading, error, errorMessage } = fetchFacebook(
		101247334652717,
		'EAADy2ex3R8wBACWjMjRe5Q4JfvI5Nv0SIZCipBErPjuFYiLreChZCbCoS92EDo2oXX6bwmkNe5v5LszhuVUkVwTS6F59nldX0cXZBatVoApo6vZBohkZB59qKEfQOSqd8QiFo1HhCiZCMrF2ggymOJQrCx9hJZCKg78L8syxAutAz2MXGW9I3GfaTiK04ZBVhZAklDWIePqHFhkL62usmoobS',
		5
	);

	console.log(posts, loading, error, errorMessage);

	return (
		// <EmbedToggler defaultToggledOn>
		<div
			style={{
				display: 'flex',
				flexWrap: 'wrap',
				justifyContent: 'flex-start',
			}}
		>
			{posts.map((post) => (
				<FacebookEmbed
					key={post.id}
					url={`https://www.facebook.com/ExploreMovementSay/posts/${post.id.split('_')[1]}`}
					width={500}
					height={500}
					showText={false}
					showMedia={false}
					showSocialContext={false}
					showTimestamp={false}
				/>
			))}
		</div>
		// </EmbedToggler>
	);
}

export default Actualites;
